import React from 'react';
import Search from "../components/Search";
import Card from "../components/Card";
import Alert from "../components/Alert";

const Home = () => {
    const cards = new Array(15).fill('').map((_, index) => index)
    return (
        <>
            <Alert/>
            <Search/>
            <div className="row">
                {cards.map(item => (
                    <div className="col-sm-4 mb-4" >
                        <Card/>
                    </div>
                ))}
            </div>

        </>
    );
};

export default Home;
